import React, { useCallback } from "react";

export default function Embed() {
  return (
    <>
      <h1>This is a random webpage</h1>
      <div className="embed-body" style={{ display: "flex" }}>
        <iframe
          src="http://localhost:3000/interact"
          width="40%"
          height="400"
          style={{
            border: "4px solid black",
            position: "fixed",
            bottom: "10px",
            right: "20px",
          }}
        ></iframe>
      </div>
    </>
  );
}
